script:
//* TITLE April Fool's **//
//* VERSION 1.0.1 **//
//* DESCRIPTION Brings back various jokes Tumblr did for April 1st **//
//* DETAILS Brings back Framed Avatars, AOL Instant Messenger, and The Missing E from 2018's Tumblr April Fools. **//
//* DEVELOPER New-XKit **//
//* FRAME false **//
//* BETA false **//

XKit.extensions.april_fools = new Object({

	running: false,
	aim_done: false,
	messages: parseInt($(".messaging_notice_container .tab_notice_value").html()),
	blogs: XKit.tools.get_blogs(),
	aim_send: "data:audio/x-wav;base64,",
	aim_receive: "data:audio/x-wav;base64,",

	preferences: {
		"mutualchecker": {
			text: "Mutual Checker&emsp;<a style=\"cursor: pointer;\" id=\"frame_reqs\">Requirements</a>",
			type: "separator"
		},
		"frames": {
			text: "Frame avatars",
			default: true,
			value: true
		},

		"messaging_tweaks": {
			text: "Messaging Tweaks&emsp;<a style=\"cursor: pointer;\" id=\"aim_reqs\">Requirements</a>",
			type: "separator"
		},
		"aim": {
			text: "AOL Instant Messenger",
			experimental: true,
			default: true,
			value: true
		},

		"classic_header": {
			text: "Header Options&emsp;<a style=\"cursor: pointer;\" id=\"e_reqs\">Requirements</a>",
			type: "separator"
		},
		"missing_e": {
			text: "The Missing E",
			default: true,
			value: true
		}
	},

	cpanel: function() {
		$('.xkit-extension-setting[data-setting-id="aim"]').after(
			`<a
				href="https://www.tumblr.com/settings/labs#labs_user_experiment_338"
				style="
					font-size: 12px;
					font-weight: bold;
					position: absolute;
					transform: translate(340px, -33px);
				"
			>Also available at Tumblr Labs &rarr;</a>`
		);

		$("#frame_reqs").click(function() {
			XKit.window.show(
				"Framed Avatars Requirements",
				`To activate this option, you must:
				<ul style="list-style-type: disc; margin-left: 1.5em;" id="frame_checklist">
					<li>Have Mutual Checker enabled</li>
				</ul>`,
				"info",
				`<div class="xkit-button default" id="xkit-close-message">OK</div>`
			);
			XKit.installed.when_running("mutualchecker",
				function() {
					$("#frame_checklist li").eq(0).append("&ensp;✔️");
				},
				function() {
					$("#frame_checklist li").eq(0).append("&ensp;❌");
				}
			);
		});
		$("#aim_reqs").click(function() {
			XKit.window.show(
				"AIM Requirements",
				`To activate this option, you must:
				<ul style="list-style-type: disc; margin-left: 1.5em;" id="aim_checklist">
					<li>Have Messaging Tweaks enabled</li>
					<li>Use its notification sounds</li>
				</ul>`,
				"info",
				`<div class="xkit-button default" id="xkit-close-message">OK</div>`
			);
			XKit.installed.when_running("messaging_tweaks",
				function() {
					$("#aim_checklist li").eq(0).append("&ensp;✔️");
					if (XKit.extensions.messaging_tweaks.preferences.sound_notification.value) {
						$("#aim_checklist li").eq(1).append("&ensp;✔️");
					} else {
						$("#aim_checklist li").eq(1).append("&ensp;❌");
					}
				},
				function() {
					$("#aim_checklist li").eq(0).append("&ensp;❌");
				}
			);
		});
		$("#e_reqs").click(function() {
			XKit.window.show(
				"The Missing E Requirements",
				`To activate this option, you must:
				<ul style="list-style-type: disc; margin-left: 1.5em;" id="e_checklist">
					<li>Have Header Options enabled</li>
					<li>Use its full tumblr logo option</li>
				</ul>`,
				"info",
				`<div class="xkit-button default" id="xkit-close-message">OK</div>`
			);
			XKit.installed.when_running("classic_header",
				function() {
					$("#e_checklist li").eq(0).append("&ensp;✔️");
					if (XKit.extensions.classic_header.preferences.fix_logo.value) {
						$("#e_checklist li").eq(1).append("&ensp;✔️");
					} else {
						$("#e_checklist li").eq(1).append("&ensp;❌");
					}
				},
				function() {
					$("#e_checklist li").eq(0).append("&ensp;❌");
				}
			);
		});
	},

	run: function() {
		this.running = true;
		XKit.tools.init_css("april_fools");

		if (this.preferences.frames.value) {
			XKit.installed.when_running("mutualchecker",
				function() {
					XKit.post_listener.add("april_fools_frames", XKit.extensions.april_fools.do_frames);
					XKit.extensions.april_fools.do_frames();
				},
				function() {
					XKit.extensions.april_fools.preferences.frames.value = false;
				}
			);
		}

		if (this.preferences.aim.value) {
			if ($("body").hasClass("flag--aim-messenger")) {
				this.preferences.aim.value = false;
				XKit.storage.set("april_fools", "extension__setting__aim", "false");
			} else {
				XKit.installed.when_running("messaging_tweaks",
					function() {
						if (XKit.extensions.messaging_tweaks.preferences.sound_notification.value) {
							XKit.extensions.messaging_tweaks.notification_sound = XKit.extensions.april_fools.aim_receive;
							$(".compose-text-input-container .submit-button .submit").click(function() {
								new Audio(XKit.extensions.april_fools.aim_send).play();
							});
							$(document).on("keydown", XKit.extensions.april_fools.key_down);
							XKit.extensions.april_fools.observer.observe($("body")[0], {
								childList: true, subtree: true
							});
							$("body").first().addClass("flag--aim-messenger");
							XKit.extensions.april_fools.aim_done = true;
						} else {
							XKit.extensions.april_fools.preferences.aim.value = false;
						}
					},
					function() {
						XKit.extensions.april_fools.preferences.aim.value = false;
					}
				);
			}
		}

		if (this.preferences.missing_e.value) {
			XKit.installed.when_running("classic_header",
				function() {
					if (XKit.extensions.classic_header.preferences.fix_logo.value) {
						$(".logo .png-logo").after(`<div class="missing-e-logo"></div>`).css("display", "none");
					} else {
						XKit.extensions.april_fools.preferences.missing_e.value = false;
					}
				},
				function() {
					XKit.extensions.april_fools.preferences.missing_e.value = false;
				}
			);
		}
	},

	do_frames: function() {
		$(".post_avatar_link:not(.xkit-fools-done)").each(function() {
			var $avatar = $(this).addClass("xkit-fools-done"), json_obj, username;
			try {
				json_obj = JSON.parse($avatar.attr("data-tumblelog-popover"));
				username = json_obj.name;
			} catch (e) {
				username = $avatar.attr("data-tumblelog-name") || JSON.parse($avatar.attr("data-peepr")).tumblelog;
			}
			if (XKit.extensions.april_fools.blogs.indexOf(username) !== -1) {
				if (!$avatar.parent().hasClass("avatar")) {
					$avatar.parent().addClass("tbc-frame-avatar");
				}
			} else if (json_obj.following) {
				if (typeof XKit.extensions.mutualchecker.mutuals[username] === "undefined") {
					XKit.interface.is_following(username, XKit.extensions.mutualchecker.preferences.main_blog.value).then(function(follow) {
						if (follow) {
							$avatar.parent().addClass("tbc-frame-avatar");
							XKit.extensions.mutualchecker.mutuals[username] = true;
						} else {
							XKit.extensions.mutualchecker.mutuals[username] = false;
						}
					});
				} else if (XKit.extensions.mutualchecker.mutuals[username]) {
					$avatar.parent().addClass("tbc-frame-avatar");
				}
			}
		});
	},

	observer: new MutationObserver(function(ms) {
		var prevcount = XKit.extensions.april_fools.messages;
		XKit.extensions.april_fools.messages = parseInt($(".messaging_notice_container .tab_notice_value").html());
		if (prevcount < XKit.extensions.april_fools.messages) {
			new Audio(XKit.extensions.april_fools.aim_receive).play();
		}
	}),

	key_down: function(e) {
		if (e.which == 13 && $(".conversation-compose .text-input-container .text-input:focus").length && $(".submit.submitted").length) {
			new Audio(XKit.extensions.april_fools.aim_send).play();
		}
	},

	destroy: function() {
		this.running = false;
		XKit.tools.remove_css("april_fools");
		XKit.post_listener.remove("april_fools_frames");
		$(".tbc-frame-avatar").removeClass("tbc-frame-avatar");
		$(".xkit-fools-done").removeClass("xkit-fools-done");
		if (XKit.extensions.april_fools.aim_done) {
			$("body").first().removeClass("flag--aim-messenger");
			$(".compose-text-input-container .submit-button .submit").off("click");
			$(document).off("keydown");
		}
		$(".missing-e-logo").remove();
		$(".logo .png-logo").css("display", "");
	}
});

css:
.tbc-frame-avatar:after {
	background-image: url("https://new-xkit.github.io/XKit/Extensions/dist/page/images/frame.png");
	content: "";
	position: absolute;
	top: -10px;
	bottom: 0;
	left: -11px;
	width: 86px;
	height: 92px;
	pointer-events: none;
	background-repeat: no-repeat;
}
@media only screen and (-webkit-min-device-pixel-ratio:1.3),only screen and (-webkit-min-device-pixel-ratio:1.3020833333333333),only screen and (min--moz-device-pixel-ratio:1.3),only screen and (min-resolution:1.3dppx),only screen and (min-resolution:125dpi) {
	.tbc-frame-avatar:after {
		background-image: url("https://new-xkit.github.io/XKit/Extensions/dist/page/images/frame-2x.png");
		background-size: 100% auto;
	}
}

